import React, { Component } from 'react'
import { View, Text, Image,StyleSheet,TextInput,Button,TouchableOpacity} from 'react-native'
//import { Button } from 'react-native-elements';
 export default class PetScreen extends Component {
   state = {
      data: ''
   }

   componentDidMount = () => {
    fetch('https://jsonblob.com/api/d5d1c918-1b49-11eb-9893-dffe65966cab',  {
         method: 'GET'
      })
      .then((response) => response.json())
      .then((responseJson) => {
         console.log(responseJson);
         this.setState({
            data: responseJson
         })
      })
      .catch((error) => {
         console.error(error);
      });
   }
   render() {
      return (
         <View style={{backgroundColor:'grey',padding:'30px'}}>
 <Image 
          style={{ width: '200px', height: '100px' ,alignItems:'center',justifyContent:'center'}}
          source={{uri:this.state.data.image}}
        />
            <Text>
             Pet Name : {this.state.data.petName}
            </Text>
            <Text>
              Pet Age : {this.state.data.petAge}
            </Text>
            <Text>
             Pet Location :  {this.state.data.petLocation}
            </Text>
            <Text>
             Pet Breed :  {this.state.data.petBreed}
            </Text>
           <Text>Owner Details :</Text>
           
         <Text style={{
            padding:20,
            height:100,
            margin:10,
            borderWidth:1,
            backgroundColor:'#fff'
         }}>
           {this.state.data.OwnerDetails}
         </Text>
         {/*<View style={{color:"black",flexDirection:"row"}}><Button color="white" textcolor="black"
  title="Call to Owner"
/> &nbsp;&nbsp;&nbsp;
      <Button color="black" title="Delete"></Button></View>*/}
      <TouchableOpacity style={styles.button} >
         <Text>Call to Owner</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.button} >
         <Text>Delete</Text>
      </TouchableOpacity>
         </View>
         
      )
   }
}

//export default PetScreen
const styles = StyleSheet.create({
   container: {
    // flex: 1,
    // backgroundColor: '#fff',
     //backgroundColor: 'green',
     color:'red',
     //alignItems: 'center',
    // justifyContent: 'center',
   },
   button: {
      alignItems: "center",
      backgroundColor: "#DDDDDD",
      flexDirection:"column",
      padding: 10
    }})
